bio:
There are multiple artists tracked as "Balrog" on Last.fm;

1) Balrog is a Black Metal band from Paris (France). It currently has one member: Balrog (Sébastien Tuvi). The band was formed up in 1999. Balrog released 3 albums: Kill Yourself (2001), Bestial Satanic Terror (2006) and Ars Talionis - The Art Of Retaliation (2007).

2) Balrog is also the name of a French dungeon synth project created early 2014, Inspired by J.R.R. Tolkien's universe. It also features elements of fantasy, ambient and folk music. <a href="https://www.last.fm/music/Balrog">Read more on Last.fm</a>
